import React from "react";

export const Sidebar = () => {
  return (
    <section className="sidebar_section">
      <div className="mini_sidebar bg-dark vh-100">
        <ul className="ul ">
          <li className="sidebar_menu_item d-flex justify-content-start align-items-center">
            <i className="icon fas fa-tachometer-alt text-light bg-dark"></i>
            <span className="text-light">داشبورد</span>
          </li>
        </ul>
      </div>
    </section>
  );
};
